import {Grid, GridItem, Text, Button} from '@chakra-ui/react';

const FacultyMember = ({ member, color }) => {
    return(
        <Grid
            templateRows="repeat(2, 1fr)"
            templateColumns="repeat(2, 1fr)"
            bg={color}
            padding=".5em"
        >
            <GridItem
                rowSpan={2}
            >
                <Text>{member}</Text>
            </GridItem>
            <GridItem>
                <Button>Edit</Button>
            </GridItem>
        </Grid>
    )
}

export default FacultyMember;
